import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

export default function SiteHeader() {
  return (
    <>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </>
  );
}
